from time import sleep
import keyboard

string = ""

def type(character):
	if character in "ABCDEFGHIJKLMNOPQRSTUVWXYZ":
		keyboard.press("shift")
		keyboard.send(character.lower())
		keyboard.release("shift")

	elif character == "/":
		keyboard.send("slash")

	elif character == "+":
		keyboard.send("plus")

	elif character == "=":
		keyboard.send("=")

	else:
		keyboard.send(character)

	sleep(0.1)


sleep(10)
iterator = 1

for character in string:
	print(character)
	type(character)
	if iterator % 100 == 0:
		print(iterator)
		sleep(5)
	iterator = iterator + 1